async function decrypt(e) {
  e.preventDefault();
  var pw = document.getElementById('pw').value;
  try {
    var salt = Uint8Array.from(atob(PAYLOAD.salt), c => c.charCodeAt(0));
    var iv = Uint8Array.from(atob(PAYLOAD.iv), c => c.charCodeAt(0));
    var ct = Uint8Array.from(atob(PAYLOAD.ct), c => c.charCodeAt(0));
    var enc = new TextEncoder();
    var keyMaterial = await crypto.subtle.importKey('raw', enc.encode(pw), 'PBKDF2', false, ['deriveKey']);
    var key = await crypto.subtle.deriveKey({name:'PBKDF2',salt:salt,iterations:100000,hash:'SHA-256'}, keyMaterial, {name:'AES-GCM',length:256}, false, ['decrypt']);
    var decrypted = await crypto.subtle.decrypt({name:'AES-GCM',iv:iv}, key, ct);
    var html = new TextDecoder().decode(decrypted);
    document.open();
    document.write(html);
    document.close();
  } catch(ex) {
    document.getElementById('err').style.display = 'block';
    document.getElementById('pw').value = '';
    document.getElementById('pw').focus();
  }
  return false;
}
</script>
